function Listings() {
    return (
            <div style={{position: 'relative'}}>
                <div style={{textAlign: 'center', position: 'absolute', paddingLeft: '12%',bottom: '35%',paddingRight: '10%'}}>
                    <section id="listings">
                        <h1 style={{fontSize: '9vh', fontFamily: 'Newslab, georgia, Bakersville'}}>Available Listings</h1>
                    </section>
                </div>
            </div>
    );
}

export default Listings;
